using BarsWeb.Core.Models;
using BarsWeb.Models;
using System;
using System.Collections.Generic;
using System.Data.Objects;
using System.Linq;
using Bars.Oracle;
using Oracle.DataAccess.Client;
using System.Web;
using System.Data;
using BarsWeb.Core.Extensions;
using Oracle.DataAccess.Types;

namespace BarsWeb.Areas.EDeclarations.Infrastructure.DI.Implementation
{
    public class EDeclarationsRepository : IEDeclarationsRepository
    {
        readonly EDeclarationsModel _EDeclarations;
        readonly IKendoSqlTransformer _sqlTransformer;
        readonly IKendoSqlCounter _kendoSqlCounter;
        readonly IParamsRepository _globalData;
        private IOraConnection connect;
        public EDeclarationsRepository(IKendoSqlTransformer sqlTransformer, IKendoSqlCounter kendoSqlCounter, IParamsRepository globalData)
        {
            _EDeclarations = new EDeclarationsModel(EntitiesConnection.ConnectionString("EDeclarationsModel", "EDeclarations"));

            _sqlTransformer = sqlTransformer;
            _kendoSqlCounter = kendoSqlCounter;
            _globalData = globalData;
            connect = (IOraConnection)AppDomain.CurrentDomain.GetData("OracleConnectClass");
        }

        #region Global search & Count
        public IEnumerable<T> SearchGlobal<T>(DataSourceRequest request, BarsSql searchQuery)
        {
            BarsSql query = _sqlTransformer.TransformSql(searchQuery, request);
            var item = _EDeclarations.ExecuteStoreQuery<T>(query.SqlText, query.SqlParams).ToList();
            return item;
        }
        public decimal CountGlobal(DataSourceRequest request, BarsSql searchQuery)
        {
            BarsSql query = _kendoSqlCounter.TransformSql(searchQuery, request);
            ObjectResult<decimal> res = _EDeclarations.ExecuteStoreQuery<decimal>(query.SqlText, query.SqlParams);
            decimal count = res.Single();
            return count;
        }
        public IEnumerable<T> ExecuteStoreQuery<T>(BarsSql searchQuery)
        {
            return _EDeclarations.ExecuteStoreQuery<T>(searchQuery.SqlText, searchQuery.SqlParams);
        }

        public int ExecuteStoreCommand(string commandText, params object[] parameters)
        {
            return _EDeclarations.ExecuteStoreCommand(commandText, parameters);
        }

        public Params GetParam(string id)
        {
            return _globalData.GetParam(id);
        }

        public Int32? CreateRequest(BarsSql sql)
        {
            OracleParameterCollection collection = ExecuteOracleRequest(sql);
            OracleDecimal oraDecimal = (OracleDecimal)collection["p_decl_id"].Value;
            return oraDecimal.IsNull? (Int32?)null: Convert.ToInt32(oraDecimal.Value);
        }

        private OracleParameterCollection ExecuteOracleRequest(BarsSql barsSql)
        {
            using (OracleConnection con = connect.GetUserConnection(HttpContext.Current))
            {
                using (OracleCommand cmd = con.CreateCommand())
                {
                    cmd.CommandType = CommandType.StoredProcedure;
                    cmd.CommandText = barsSql.SqlText;
                    cmd.Parameters.Clear();
                    cmd.BindByName = true;
                    cmd.Parameters.AddRange(barsSql.SqlParams);

                    using (var reader = cmd.ExecuteReader())
                        return cmd.Parameters;
                }
            }
        }

        public Int32 SearchDeclaration(BarsSql sql)
        {
            OracleParameterCollection collection = ExecuteOracleRequest(sql);
            OracleDecimal dec = (OracleDecimal)collection["p_resp"].Value;
            return Convert.ToInt32(dec.Value);
        }

        public Byte[] GetDeclarationFile(BarsSql sql)
        {

            using (OracleConnection con = connect.GetUserConnection(HttpContext.Current))
            {
                using (OracleCommand cmd = con.CreateCommand())
                {
                    cmd.CommandType = CommandType.StoredProcedure;
                    cmd.CommandText = sql.SqlText;
                    cmd.Parameters.Clear();
                    cmd.BindByName = true;
                    cmd.Parameters.AddRange(sql.SqlParams);

                    using (var reader = cmd.ExecuteReader())
                        using (OracleClob oraClob = (OracleClob)cmd.Parameters["p_clob"].Value)
                            return oraClob.IsNull ? new Byte[0] : Convert.FromBase64String(oraClob.Value);
                }
            }
            //OracleParameterCollection collection = ExecuteOracleRequest(sql);
            //using (OracleClob oraClob = (OracleClob)collection["p_clob"].Value)
            //    return oraClob.IsNull ? new Byte[0] : Convert.FromBase64String(oraClob.Value);
            //return Convert.FromBase64String("");
        }
        #endregion
    }
}
